  [],\n\t\"revision_timestamp\": \"2016-10-08T17:04:38.904117\",\n\t\"name\": \"enviroatlas-estimated-percent-tree-cover-along-walkable-roads-web-service\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas dataset estimates tree
  cover along walkable roads. The road width is estimated for each road and percent
  tree cover is calculated in a 8.5 meter strip beginning at the estimated road edge.
  Percent tree cover is calculated for each block between road intersections. Tree
  cover provides valuable benefits to neighborhood residents and walkers by providing
  shade, improved aesthetics, and outdoor gathering spaces. For specific information
  about each community's intersection density layer, consult their individual metadata
  records: Austin, TX (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B4876FD99-C14A-464A-9E31-5CB5F2225687%7D);
  Des Moines, IA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B09FE7D60-B636-405C-BB07-68147DFE8CAF%7D);
  Durham, NC (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BF341A26B-4972-4C6B-B675-9B5E02F4F25F%7D);
  Fresno, CA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BB71334B9-C53A-4674-A739-1031969E5163%7D);
  Green Bay, WI (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BB9AFEBED-9C29-4DB0-8B54-0CAF58BE5A2D%7D);
  Memphis, TN (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BBE552E7A-A789-4AA9-ADF9-234109C6517E%7D);
  Milwaukee, WI (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B922381C1-009A-4EC6-AAE8-7809AE0B23D7%7D);
  New Bedford, MA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BECA7BDD7-8461-4C97-A406-B52B7B453282%7D);
  New York, NY (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BD8406925-C2A8-4E29-991F-0BA8FC2DB685%7D);
  Phoenix, AZ (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B6A2FE776-5822-4137-BCB9-02D54F772C72%7D);
  Pittsburgh, PA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B9DFA46F0-5610-4BB0-AD19-0812DA87A736%7D);
  Portland, ME (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B8CE26C98-E877-4450-9CEF-F6861B342183%7D);
  Paterson, NJ (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B5786F2F1-5005-4A23-A754-71A8E25AA081%7D);
  Portland, OR (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B1CFC7DBB-E245-4C83-84AE-81D950FEC51E%7D);
  Tampa, FL (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B790D6F59-241C-40FD-B603-337A4CEA9299%7D);
  and Woodbine, IA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B2F091ED2-8A69-47AA-82B5-75A5A4FFABE4%7D).
  This dataset was produced by the US EPA to support research and online mapping activities
  related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the
  user to interact with a web-based, easy-to-use, mapping application to view and
  analyze multiple ecosystem services for the contiguous United States. The dataset
  is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
  or as an EnviroAtlas map service. Additional descriptive information about each
  attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
  (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
